input[type=\"search\"].value:
linear-gradient(
    to right,
    transparent,
    var(--text-accent),
    transparent
  )

.prompt.value:
linear-gradient(
    to top,
    transparent,
    var(--text-accent),
    transparent
  )

input.prompt-input.value:
linear-gradient(
    to right,
    transparent,
    var(--text-accent),
    transparent
  )

.markdown-rendered pre.value:
linear-gradient(
    to right,
    transparent,
    var(--text-accent),
    transparent
  )
